  [],\n\t\"revision_timestamp\": \"2016-10-15T16:36:14.349893\",\n\t\"name\": \"prime-hook-national-wildlife-refuge-annual-narrative-report-calendar-year-1981\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Prime Hook National
  Wildlife Refuge outlines Refuge accomplishments during the 1981 calendar year. The
  report begins with Refuge highlights and information about climatic conditions,
  land acquisition, planning, and administration. Habitat management is covered; croplands,
  grasslands, wetlands, forestlands, prescribed fire, and vegetation control are discussed.
  The wildlife section of the report discusses endangered and threatened species,
  migratory birds, and mammals. Interpretation and recreation activities are outlined;
  topics include information and interpretation, recreation, hunting, fishing, fur
  trapping, wildlife observation, and law enforcement. The equipment and facilities
  discusses new construction, rehabilitation, equipment utilization and maintenance,
  communications systems, and energy conservation.  Cooperative programs are discussed.
  Photographs are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
